import './Header.css'

const Header = () => {
    return (
        <nav class="navbar bg-body-tertiary">
            <div class="container-fluid">
                <a class="navbar-brand" href="#">
                    <img src="/img/Logo.jpg" alt="Logo" width="30" height="24" class="d-inline-block align-text-top"/>
                        XXGaming
                </a>
            </div>
        </nav>
    );
}

export default Header;
